description:
Tehlukesizlik kameralarinin ve tehlukesizlik sistemlerinin genis assortimenti
Her nov tehlukesizlik kamerasi (Ip kamera, zoomlu kamera, box kamera, speed dome kamera, dome kamera, IR kamera, col kamera ve s.);
Domofon (videodomofon, ip domofon);
Turniket (tekayaqli, ikiayaqli ve s.);
Slaqbaum ;
Biometrika (sade, kartla kecid, barmaq izi ile kecid);
Butun mehsullara 2 il zemanet verilir. 6ay pulsuz sevis xidmeti.
.
